import React from "react"

const Indexmenu = ({ link, alt, heading }) => {
  return (
    <div className="indexmenu" alt={alt} style={{ backgroundImage: { link } }}>
      <h2>{heading}</h2>
    </div>
  )
}
export default Indexmenu
